import collections
def hasGroupsSizeX(deck):
    """
    :type deck: List[int]
    :rtype: bool
    """

    if len(deck)==1: return False

    counter = collections.Counter(deck)
    # x = min(counter.values())
    # if x==1:return False
    # print(counter)
    # while x % 2 == 0 and x // 2 >= 2:
    #     x = x // 2

    for factor in range(2, max(counter.values())+1):
        possible = True
        for k in counter:
            if not counter[k] % factor==0:
                possible = False
        if possible:
            return True

    return False

